package Parsing;

public class ParsingDemo {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		String s1= "10";
		String s2= "20";
		System.out.println(s1+s2);
		Integer i= Integer.parseInt(s1);
		Integer j= Integer.parseInt(s2);
		System.out.println(i+j);
 
	}

}
